import React from 'react'
import ReactDOM from 'react-dom'

const App = () => {
    const feedback = {
        title: 'Give feedback',
        votes: {
            good: 0,
            neutral: 0,
            bad: 0
        }
    }

    const addUpVote = () =>
        console.log('vote up')

    const addNeutralVote = () =>
        console.log('neutral vote')

    const addDownVote = () =>
        console.log('vote down')

    return (
        <div>
            <Header {...feedback}/>
            <Buttons/>

        </div>
    )
}

const Header = (props) => {
    return (

        <h1>{props.title}</h1>
    )
}

const Buttons = (props) => {
    return (
        <>
            <button onClick={addUpVote}>Vote up</button>
            <button onClick={addNeutralVote}>Vote neutral</button>
            <button onClick={addDownVote}>Vote down</button>
        </>
    )
}
